export default {
    state: {
        isCollapsed: false,
        tabsList: [
            {
                path: '/',
                name: 'home',
                label: '扶뒬매',
                icon: 'HomeFilled'
            }
        ],
        currentMenu: null
    },
    mutations: {
        collapseMenu(state) {
            state.isCollapsed = !state.isCollapsed;
        }
    }
}
